<section class="mainbanner">
  <section class="banner-section">
    <section class="slider">
      <ngx-slick-carousel
        class="carousel"
        #slickModal="slick-carousel"
        [config]="slideConfig"
      >
        <div ngxSlickItem *ngFor="let slide of slides" class="slide">
          <img class="img" src="{{ slide.img }}" alt="" />
        </div>
      </ngx-slick-carousel>
    </section>
    <section class="text">
      <h1 class="header">
        Effortless Clean-up for <span class="hightlighted"> Any Project</span>
      </h1>
      <h2>
        Become a partner and see how <strong>MG Waste Removal Corp</strong
        ><br />
        can <strong>save you a significant amount</strong> every year,
        <br />thanks to our monthly specials <br />
        and referral incentives.
      </h2>
      <button class="button" mat-raised-button>Reserve Now</button>
    </section>
  </section>
  <article class="service-request">
    <div class="form-container">
      <p class="header">Request Your Waste Removal Service Today</p>
      <div class="input-text">
        <!-- Other input elements -->
        <div class="main-container" style="margin-right: 25px">
          <input
            placeholder="3950 Nw 3rd St, Miami, Fl, 33126"
            type="text"
            id="address"
          />
          <label for="address">Service Address</label>
        </div>
        <!-- First Dropdown -->
        <div
          class="main-selector"
          #dropdownContainer1
          (click)="toggleDropdown(1)"
        >
          <input
            #selectorInput1
            placeholder="Select"
            type="text"
            id="selectorx1"
            readonly
          />
          <label for="selectorx1">For home or business?</label>
          <mat-icon
            class="arrow"
            [ngClass]="{ 'arrow-up': isDropdownOpen === 1 }"
            matSuffix
          >
            arrow_drop_down
          </mat-icon>
          <div *ngIf="isDropdownOpen === 1" class="dropdown-content">
            <!-- Dropdown options -->
          </div>
        </div>

        <!-- Second Dropdown -->
        <div
          class="main-selector"
          #dropdownContainer2
          (click)="toggleDropdown(2)"
          style="margin-left: 25px"
        >
          <input
            #selectorInput2
            placeholder="Select"
            type="text"
            id="selectorx2"
            readonly
          />
          <label for="selectorx2">Business Type</label>
          <mat-icon
            class="arrow"
            [ngClass]="{ 'arrow-up': isDropdownOpen === 2 }"
            matSuffix
          >
            arrow_drop_down
          </mat-icon>
          <div *ngIf="isDropdownOpen === 2" class="dropdown-content">
            <!-- Dropdown options -->
          </div>
        </div>

        <button class="button" mat-raised-button>Get Started</button>
      </div>
    </div>
  </article>
</section>
